40	Samsung Galaxy S22 Ultra	0	23190000	800000	Samsung Galaxy S22 Ultra 5G 512GB - là chiếc điện thoại Galaxy S đầu tiên hỗ trợ bút S Pen tích hợp bên trong thân máy, có nhiều cải tiến về camera, màn hình ấn tượng hơn và hỗ trợ sạc 45 W nhanh hơn.	{"qua_tang": [], "uu_dai_goi": []}	device/image/samsung-galaxy-s22-ultra-den-1.jpg	\N	{"Camera sau": [["Độ phân giải", " Chính 108 MP & Phụ 12 MP, 10 MP, 10 MP"]], "Màn hình": [["Công nghệ màn hình", " Dynamic AMOLED 2X"], ["Độ phân giải", " 2K+ (1440 x 3088 Pixels)"], ["Màn hình rộng", "6.8\\" - Tần số quét 120 Hz"], ["Độ sáng tối đa", " 1750 nits"], ["Mặt kính cảm ứng", "Kính cường lực Corning Gorilla Glass Victus+"]], "Camera trước": [["Độ phân giải", " 40 MP"]], "Hệ điều hành & CPU": [["Hệ điều hành", " Android 12"], ["Chip xử lý (CPU)", " Snapdragon 8 Gen 1 8 nhân"], ["Tốc độ CPU", " 1 nhân 3 GHz, 3 nhân 2.5 GHz & 4 nhân 1.79 GHz"], ["Chip đồ họa (GPU)", " Adreno 730"]]}	<h3 style="margin-left:0px;text-align:justify;"><a href="https://www.thegioididong.com/dtdd/samsung-galaxy-s22-ultra-256gb">Samsung Galaxy S22 Ultra 256GB</a> - chiếc điện thoại Galaxy S đầu tiên sở hữu bút S Pen trong thân máy, được cung cấp sức mạnh bởi CPU đến từ Qualcomm, sở hữu thiết kế sang trọng, màn hình có nhiều cải tiến cùng cụm camera zoom 100x.&nbsp;</h3><h3 style="margin-left:0px;text-align:justify;">Thiết kế khác biệt hoàn toàn thế hệ trước</h3><p style="margin-left:0px;text-align:justify;">Samsung Galaxy S22 Ultra 256GB ra mắt với một diện mạo “cũ mà mới”, máy sử dụng form thiết kế của dòng <a href="https://www.thegioididong.com/dtdd-samsung-galaxy-note">Galaxy Note</a> trước đây để đưa vào dòng <a href="https://www.thegioididong.com/dtdd-samsung-galaxy-s">Galaxy S</a>. Với hai cạnh trên và dưới vát phẳng, hai bên thì được bo cong mềm mại.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053939.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053939.jpg" alt="Thiết kế khác biệt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Đây cũng là một chiếc <a href="https://www.thegioididong.com/dtdd">smartphone</a> vô cùng bền bỉ khi khung viền được cấu thành từ Armor Aluminum cứng cáp và đây cũng là một trong những sản phẩm được trang bị kính Corning Gorilla Glass Victus+ đầu tiên trên thị trường.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060516.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060516.jpg" alt="Khung viền cứng cáp - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Mặt lưng hoàn thiện nhám, màu sắc khá sang và có khả năng hạn chế bám vân tay tốt, máy có các phiên bản màu như: Xanh lá, đỏ rượu vang và 2 màu truyền thống là đen và bạc.</p><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra cho cảm giác cầm nắm khá thích, khối lượng vừa phải, không bị cấn tay nhưng nếu cầm trần thì cảm giác hơi dễ trượt vì kích thước máy khá là lớn.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053941.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053941.jpg" alt="Cảm giác cầm rất tốt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Thiết kế cụm camera trên máy cũng là một điểm nhận dạng Galaxy S22 Ultra năm nay khác biệt so với dòng Note, cụm camera không còn quá lồi nữa giúp cho máy không bị kênh nhiều khi đặt trên mặt phẳng.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055511.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055511.jpg" alt="Cụm camera trên Samsung Galaxy S22 Ultra"></a></p><h3 style="margin-left:0px;text-align:justify;">Lần đầu tiên S Pen xuất hiện</h3><p style="margin-left:0px;text-align:justify;">Galaxy S22 là <a href="https://www.thegioididong.com/dtdd-samsung">điện thoại Samsung</a> dòng S đầu tiên trang bị bút S Pen bên trong máy, bút S Pen năm nay cũng đã được Samsung cải tiến nhiều về độ trễ, thời gian trễ được rút ngắn lại chỉ còn 2.8 ms nên cảm giác khi viết trên màn hình Galaxy S22 Ultra này khá là chân thật và chính xác.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053919.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053919.jpg" alt="S Pen đã có mặt trên Galaxy S - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tất cả các tính năng như viết, các chức năng ghi chú, Screen Note, Dịch đều giống như những gì đã có trên Galaxy Note, các cử chỉ điều khiển từ xa vẫn như trên thế hệ Note, bạn cũng có thể kích hoạt camera từ xa, chuyển đổi qua lại giữa các chế độ chụp rất nhanh chóng và chính xác. Phần giao diện dường như được cập nhật theo hướng to hơn, rõ ràng hơn.</p><h3 style="margin-left:0px;text-align:justify;">Camera độ phân giải cao, zoom cực xa</h3><p style="margin-left:0px;">Trang bị 4 ống kính với ống kính chính lên đến 108 MP, <a href="https://www.thegioididong.com/dtdd-camera-goc-rong">camera&nbsp;góc siêu rộng</a> 12 MP, 2 camera tele cùng 10 MP hỗ trợ thu phóng quang học 10x. Năm nay <a href="https://www.thegioididong.com/samsung">Samsung</a> đã nhấn mạnh rất nhiều qua cái câu tagline "Mắt thần bóng đêm", nhắc đến khả năng chụp đêm của Galaxy S22 Ultra.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055512.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055512.jpg" alt="Cụm camera siêu tốt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Thật sự thì Samsung Galaxy S22 Ultra chụp thiếu sáng cực kỳ ngon, hình ảnh cực kỳ sáng, sắc nét và trong trẻo, không bị noise nhiều. Cân bằng ánh sáng tốt, các ánh đèn không bị cháy lóa như khi chụp thường, kể cả các ánh sáng phức tạp của đèn LED.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053932.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053932.jpg" alt="Ảnh chụp trong môi trường thiếu sáng - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tương phản được đẩy lên cao, tăng độ rực rỡ cho tấm hình kể cả khi sử dụng các mức zoom 3x hay 10x thì ảnh vẫn có độ chi tiết tốt.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055514.jpg"><img alt="Ảnh chụp từ camera Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;"><i>Ảnh chụp từ camera góc thường</i></p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061957.jpg"><img alt="Ảnh chụp từ camera zoom - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;"><i>Ảnh chụp từ camera zoom</i></p><p style="margin-left:0px;text-align:justify;">Điều kiện đủ sáng thì không có gì để chê, hình ảnh cho ra rực rỡ, khả năng xử lý khi ngược sáng rất tốt, không bị cháy lóa, hình ảnh có độ tương phản cao cộng với chi tiết cao nên khá nịnh mắt.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053928.jpg"><img alt="Ảnh chụp từ camera chính - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Chế độ zoom 100x hoạt động cực kỳ ổn định, zoom xa và bắt ảnh khá nhanh và tất nhiên ảnh khi zoom 100x khá là mờ, khoảng cách tốt nhất để bức ảnh còn nét là khoảng 30-40x thôi.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053926.jpg"><img alt="Ảnh chụp từ camera zoom - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Chế độ chân dung có vẻ đã được cải thiện nhiều hơn so với thế hệ trước với ảnh xóa phông sâu, ít bị lẹm kể cả phần khó như tóc, độ chi tiết cao, ảnh tươi sáng và màu sắc khá chân thật. Hơn nữa máy cũng hỗ trợ nhiều chế độ chụp khác để bạn khám phá.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060509.jpg"><img alt="Hỗ trợ nhiều chế độ chụp - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra hỗ trợ <a href="https://www.thegioididong.com/hoi-dap/cac-chuan-quay-phim-tren-dien-thoai-tablet-pho-bi-1174134#8k">quay video 8K</a> tuy nhiên không đi kèm chống rung, nếu như bật chế độ Siêu ổn định lên thì độ phân giải sẽ bị giới hạn xuống Full HD 60 FPS. Bao nhiêu đó cũng khá đủ rồi, khung hình ổn định, ít bị giật, độ chi tiết cao và màu sắc cũng khá chân thật để chúng ta dễ dàng chỉnh sửa.</p><p style="margin-left:0px;text-align:justify;"><a href="https://www.thegioididong.com/dtdd-camera-macro">Camera macro</a> trên Galaxy S22 Ultra hoạt động khá giống với dòng iPhone 13 Pro, chỉ cần để chế độ chụp ảnh bình thường và dí sát vào vật thể thì máy sẽ tự động lấy nét và chuyển sang chụp macro.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053924.jpg"><img alt="Ảnh Macro chụp từ Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Camera trước lên đến 40 MP nên cho hình sống ảo của chúng ta sẽ chân thật hơn bao giờ hết, da vẫn được làm mịn nhẹ nhưng các chi tiết trên da đều sẽ được tái tạo rất rõ nét. Màu sắc khá rực rỡ nên không cần áp dụng thêm bộ lọc màu nữa.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053923.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053923.jpg" alt="Camera trước - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Camera trước cũng có khả năng quay video đến 4K 60 FPS, tự động lấy nét giúp bạn quay vlog tốt hơn.</p><h3 style="margin-left:0px;text-align:justify;">Nâng cao trải nghiệm thị giác</h3><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra trang bị một màn hình khá lớn với kích thước 6.8 inch, tấm nền Dynamic Amoled 2X độ phân giải 2K+ hiển thị vô cùng sắc nét, màu đen sâu, màu sắc hài hòa, hỗ trợ dải màu rộng DCI-P3 và đây cũng là một cực phẩm hiển thị của giới smartphone ở thời điểm hiện tại.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053921.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053921.jpg" alt="Màn hình hiển thị tuyệt vời - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tần số quét 120 Hz cũng là một trang bị không thể thiếu trên các điện thoại cao cấp, nó mang lại sự mượt mà cho tất cả tác vụ được hiển thị trên màn hình. Tần số quét sẽ được biến thiên tự động tùy vào nội dung mà chúng ta xem trên màn hình. Các thao tác vuốt chạm, các hiệu ứng hình ảnh sẽ đã mắt hơn bao giờ hết.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060940.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060940.jpg" alt="Màn hình mượt mà - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Galaxy S22 có chế độ bảo vệ mắt giúp bảo vệ đôi mắt khỏi ánh sáng xanh phát ra từ màn hình điện tử để quá trình sử dụng điện thoại của bạn trở nên thoải mái hơn. Độ sáng tối đa 1750 nits hiển thị nội dung HDR hiệu quả hơn cũng như hiển thị nội dung ngoài trời nắng cũng tốt hơn.</p><p style="margin-left:0px;text-align:justify;">Với 1750 nits thì đây là một con số cực kỳ lớn, khi so với các sản phẩm cùng phân khúc thì nó cũng sáng hơn rất nhiều.</p><h3 style="margin-left:0px;text-align:justify;">Hiệu năng khủng với chip nhà Qualcomm</h3><p style="margin-left:0px;">Hiệu năng trên Galaxy S22 Ultra cũng là một điểm đáng khen khi máy sử dụng con chip Snapdragon 8 Gen 1 đầy drama về vấn đề quá nhiệt nhưng trên Galaxy S22 Ultra lại hoàn toàn khắc phục được.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061203.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061203.jpg" alt="Hiệu năng mạnh mẽ - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Khi chơi game máy chỉ ấm lên một chút ở phần bên cạnh cụm camera chứ hoàn toàn không nóng bỏng tay như một số máy chạy Snap 8 Gen 1 trước đó. Các tác vụ làm việc văn phòng, học tập online như Word, Excel, Meet máy xử lý rất dễ dàng và nhanh chóng.</p><p style="margin-left:0px;text-align:justify;">Các tựa game Liên Quân Mobile hay PUBG Mobile thì chiếc máy này hoàn toàn dư sức cho bạn trải nghiệm chơi tốt nhất, có thể cài đặt cấu hình HDR mức đồ họa cực độ thì biểu đồ FPS của máy vẫn khá ổn định, không bị drop FPS nhiều.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053917.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053917.jpg" alt="Game PUBG Mobile - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Kể cả khi các bạn chơi Genshin Impact ở mức cấu hình mặc định thì máy chơi vẫn mượt, đồ họa vẫn rất đẹp. Chỉ đến khi bật 60 FPS lên thì máy mới bắt đầu xảy ra tình trạng giật lag, nhưng nó cũng chỉ thỉnh thoảng thôi, lúc đánh quái hay bay thì mới gặp.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053915.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053915.jpg" alt="Genshin Impact trên Samsung Galaxy S22 Ultra"></a></p><h3 style="margin-left:0px;text-align:justify;">Pin thoải mái sử dụng một ngày</h3><p style="margin-left:0px;text-align:justify;">Samsung Galaxy S22 Ultra trang bị viên pin 5000 mAh, công suất sạc thì đã được nâng lên thành 45 W. Sạc từ 0-50% trong khoảng 30 phút và mất khoảng 70 phút là đầy 100% pin.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053911.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053911.jpg" alt="Thời gian sạc - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Mình sử dụng nhiều tác vụ giải trí trong một ngày như YouTube, Facebook, rồi test game thì máy vẫn có thời gian sử dụng liên tục lên đến hơn 9 tiếng. Quá tốt cho một chiếc flagship trang bị cấu hình mạnh và màn hình độ phân giải cực cao như thế này.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053913.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053913.jpg" alt="Thời gian sử dụng - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Ngoài ra S22 Ultra còn hỗ trợ một số công nghệ sạc khác như: Sạc nhanh không dây công suất 15 W, sạc ngược không dây 4.5 W để bạn đa dạng phương thức sạc cho phù hợp với nhu cầu sử dụng.</p><p style="margin-left:0px;text-align:justify;">Nếu bạn là một tín đồ của dòng Note, thì còn ngại ngùng gì nữa mà không chọn ngay chiếc S22 Ultra với cây bút S Pen cùng nhiều đặc điểm của dòng Note huyền thoại.&nbsp;Màn hình lớn cùng, pin trâu, cấu hình cực khỏe cũng là một điểm mà bạn nên cân nhắc với chiếc điện thoại này.</p>	["/media/device/media/media_bb5bbq1671715042985n-1.jpg", "/media/device/media/media_fvsxcf1671715042988o-1.jpg"]	1	\N	1	2022-12-28 08:57:25.42204+00	1	\N
