href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-2-1.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-2-1.jpg" alt="Bao quát tốt - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><h3 style="margin-left:0px;text-align:justify;">Chất lượng hình ảnh, video đạt chuẩn phân giải Full HD (1080p)</h3><p style="margin-left:0px;text-align:justify;">Với độ phân giải này, dữ liệu thu được cho phép kiểm tra tốt các chi tiết nhỏ, hình ảnh không bị nhòe mờ cả khi phóng lớn, phục vụ tốt cho nhu cầu kiểm soát an ninh.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-3.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-3.jpg" alt="Dữ liệu phân giải cao - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><h3 style="margin-left:0px;text-align:justify;">Tầm nhìn hồng ngoại đến 10 m nhờ công nghệ WDR</h3><p style="margin-left:0px;text-align:justify;">Hỗ trợ đèn hồng ngoại giúp&nbsp;<a href="https://www.thegioididong.com/camera-giam-sat">camera</a>&nbsp;có thể quan sát tốt trong điều kiện thiếu sáng, thu giữ hình ảnh rõ ràng, chi tiết để kiểm soát hiệu quả an ninh cả ngày và đêm.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-4.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-4.jpg" alt="Giám sát hồng ngoại - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><h3 style="margin-left:0px;text-align:justify;">Sử dụng điều khiển từ xa qua ứng dụng Mi Home trên thiết bị di động</h3><p style="margin-left:0px;text-align:justify;">Tải và cài đặt Mi Home để điều khiển camera, kiểm tra dữ liệu quan sát và thực hiện các cài đặt khác thật đơn giản ngay trên thiết bị di động của bạn. Có thể sử dụng kết nối đồng thời nhiều thiết bị quản lý sử dụng Mi Home cho 1 camera.</p><p style="margin-left:0px;"><strong>Các bước thiết lập trên ứng dụng Mi Home:</strong></p><p style="margin-left:0px;text-align:justify;">- Tải xuống ứng dụng MiHome.</p><p style="margin-left:0px;text-align:justify;">-&nbsp;Bật nguồn camera.</p><p style="margin-left:0px;text-align:justify;">- Mở ứng dụng và kết nối với camera.</p><p style="margin-left:0px;text-align:justify;">Xem thêm chi tiết tại đây:&nbsp;<a href="https://www.thegioididong.com/hoi-dap/huong-dan-su-dung-chi-tiet-ung-dung-mi-home-1209528">Hướng dẫn sử dụng chi tiết ứng dụng Mi Home</a>.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-5.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-5.jpg" alt="Mi Home - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><h3 style="margin-left:0px;text-align:justify;"><a href="https://www.thegioididong.com/camera-giam-sat-xiaomi">Camera Xiaomi</a>&nbsp;tích hợp âm thanh 2 chiều để đàm thoại dễ dàng khi kết nối với điện thoại thông minh</h3><p style="margin-left:0px;text-align:justify;">Nhờ loa ngoài và micro tích hợp, thông qua điện thoại kết nối ứng dụng, bạn có thể phát đi các lệnh thoại qua camera đến khu vực lắp đặt quan sát, hơn nữa còn có thể&nbsp;đàm thoại 2 chiều, tiện lợi cho nhu cầu giao tiếp và xử lý các tình huống an ninh phát sinh.</p><p style="margin-left:0px;text-align:justify;">Ngoài ra, với trợ lý ảo&nbsp;<strong>Google Assistant hoặc Alexa</strong>, bạn còn có thể ra lệnh bằng giọng nói để điều khiển nhanh camera đầy thông minh và tiện lợi.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-6.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-6.jpg" alt="Đàm thoại - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><h3 style="margin-left:0px;text-align:justify;">Lưu trữ dữ liệu qua thẻ nhớ MicroSD dung lượng tối đa&nbsp;32 GB (4 - 5 ngày quan sát)</h3><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-90.jpg"><img src="https://cdn.tgdd.vn/Products/Images/4728/242564/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl-90.jpg" alt="Micro SD - Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL"></a></p><p style="margin-left:0px;">Sử dụng&nbsp;<a href="https://www.thegioididong.com/camera-giam-sat/camera-ip-mi-home-360-do-1080p-xiaomi-bhr4885gl">Camera IP Mi Home 360 Độ 1080P Xiaomi BHR4885GL</a>&nbsp;với khả năng quan sát tốt cả ngày lẫn đêm, bao quát tốt, điều khiển đơn giản và giàu tiện ích, mang đến lợi ích sử dụng cao cho người dùng.</p>	["/media/device/media/media_yz1x2m1675385433806ure.PNG"]	7	\N	8	2023-03-08 08:45:37.308942+00	1	\N
