19	Samsung Note 20	0	10000000	1000000	Samsung note 20	{"qua_tang": ["Tai nghe Galaxy Buds Pro"], "uu_dai_goi": [["Ưu đãi Black Friday", 1]]}	device/image/samsung2.jpeg	\N	{"Camera sau": [["Độ phân giải", "Chính 12 MP & Phụ 64 MP, 12 MP"]], "Màn hình": [["Công nghệ màn hình", "Super AMOLED Plus"], ["Độ phân giải", "Full HD+ (1080 x 2400 Pixels)"]]}	<h3 style="margin-left:0px;">Tháng 8/2020, <a href="https://www.thegioididong.com/dtdd/samsung-galaxy-note-20">smartphone&nbsp;Galaxy Note 20</a>&nbsp;chính thức được lên kệ, với thiết kế camera trước nốt ruồi quen thuộc, cụm camera hình chữ nhật mới lạ cùng với vi xử lý Exynos 990 cao cấp của chính <a href="https://www.thegioididong.com/dtdd-samsung">điện thoại&nbsp;Samsung</a>&nbsp;chắc hẳn sẽ mang lại một trải nghiệm thú vị cùng hiệu năng mạnh mẽ.</h3><h3 style="margin-left:0px;">Camera cụm hình chữ nhật độc đáo cùng thiết kế mạnh mẽ</h3><p style="margin-left:0px;"><a href="https://www.thegioididong.com/dtdd">Điện thoại</a> sở hữu thiết kế khung kim loại chắc chắn, mặt lưng nhựa bóng bẩy, kiểu dáng mạnh mẽ với những góc cạnh vuông vức nhưng vẫn mang lại cảm giác cầm nắm thoải mái.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-235720-125702.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-235720-125702.jpg" alt="Thiết kế mặt lưng nhám sang trọng - Samsung Galaxy Note 20"></a></p><p style="margin-left:0px;">Camera của Galaxy Note 20&nbsp;được thiết kế trong cụm hình chữ nhật được đặt gọn ở phía sau bao gồm 1 camera chính 64 MP, <a href="https://www.thegioididong.com/dtdd-camera-goc-rong">camera góc siêu rộng</a> 12 MP và camera tele 12 MP hỗ trợ người dùng dễ dàng lưu lại sắc nét những khoảng khắc đáng nhớ cùng gia đình và bạn bè.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-235520-015514.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-235520-015514.jpg" alt="Cụm 3 camera sau - Samsung Galaxy Note 20"></a></p><p style="margin-left:0px;">Camera Galaxy Note 20 hỗ trợ zoom đến 30x ở chế độ chụp bình thường, trong khi đó, ở chế độ chụp ban đêm, máy vẫn hỗ trợ zoom đến 10x, chi tiết trong điều kiện thiếu sáng nhiều nhưng vẫn cho chất lượng hình tốt và chi tiết.</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-224320-024303.jpg">Ảnh chụp góc thường 1x trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-224320-024309.jpg">Ảnh chụp zoom 5x trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-224320-024315.jpg">Ảnh chụp zoom 10x trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">Với khả năng quay video chất lượng cao lên đến 8K siêu nét cùng các tính năng chống rung, lấy nét,... thì việc sở hữu nhiều thước phim xịn mịn bắt mắt là điều hoàn toàn dễ dàng trên chiếc smartphone này.</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230720-020730.jpg">Ảnh chụp camera sau trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230720-020723.jpg">Ảnh chụp đêm trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">Samsung Note 20 sở hữu camera trước 10 MP trong thiết kế nốt ruồi quen thuộc giúp khung màn hình 6.7 inch được sử dụng tối đa giúp cho việc xem phim hay chơi game đã mắt và tập trung hơn.</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230020-020036.jpg">Camera trước 10 MP&nbsp;trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230720-020739.jpg">Ảnh chụp camera selfie trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230720-020749.jpg">Ảnh chụp camera selfie trên Galaxy Note 20</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230020-020036.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230020-020036.jpg" alt="Camera trước 10 MP - Samsung Galaxy Note 20"></a></p><h3 style="margin-left:0px;">Bút S Pen&nbsp;nhiều tiện ích, được nâng cấp nhiều tính năng hơn</h3><p style="margin-left:0px;">S Pen được xem là linh hồn của dòng&nbsp;Galaxy Note,&nbsp;siêu tiện lợi hỗ trợ ghi chú nhanh và đa tác vụ thông minh trên điện thoại như chụp ảnh màn hình, chụp cắt không gian bất kỳ trên màn hình, tạo ghi chú, phóng to / thu nhỏ hay hỗ trợ cử chỉ thông minh từ xa,...</p><p style="margin-left:0px;">Xem thêm:&nbsp;<a href="https://www.thegioididong.com/hoi-dap/but-s-pen-dieu-lam-nen-ten-tuoi-dong-galaxy-note-839833">Bút S-Pen: điều làm nên tên tuổi dòng Galaxy Note</a></p><p style="margin-left:0px;">Bên cạnh đó, ở Note 20, bút S Pen còn được cải tiến cho độ trễ giảm thiểu đáng kể cùng các cử chỉ điều khiển từ xa thông minh và tiện ích.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125720-105754.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125720-105754.jpg" alt="Bút S Pen kèm theo máy - Samsung Galaxy Note 20"></a></p><h3 style="margin-left:0px;">Công nghệ màn hình Super AMOLED Plus, độ phân giải Full HD+</h3><p style="margin-left:0px;">Màn hình Samsung Galaxy Note 20 sử dụng <a href="https://www.thegioididong.com/hoi-dap/man-hinh-super-amoled-plus-la-gi-905774">tấm nền Super AMOLED Plus</a> 60Hz cho màu sắc chân thực, gần với thực tế mang đến những khung hình sống động và cực kì chi tiết, độ sáng màn hình cao hơn nên khi sử dụng dưới điều kiện nắng gắt cũng không ảnh hưởng nhiều đến chất lượng hiển thị.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125820-105803.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125820-105803.jpg" alt="Màn hình hiển thị siêu rõ nét - Samsung Galaxy Note 20"></a></p><p style="margin-left:0px;">Máy được tranh bị kính cảm ứng cường lực&nbsp;Gorilla Glass 5&nbsp;cùng&nbsp;chuẩn chống nước và chống bụi là IP68, giúp cho người dùng có thể yên tâm khi dùng điện thoại ngoài đường hay vô tình tiếp xúc với nước.</p><h3 style="margin-left:0px;">Bảo mật vân tay&nbsp;trên màn hình nhanh chóng và tiện lợi</h3><p style="margin-left:0px;">Tính năng bảo mật tiên tiến chắc chắn không thể thiếu trên Note 20, với công nghệ mở khóa bằng vân tay ngay trên màn hình giúp bạn mở khóa nhanh máy chỉ với một lần chạm vô cùng nhanh chóng và tiện lợi.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125820-105811.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-125820-105811.jpg" alt="Cài đặt bảo mật vân tay - Samsung Galaxy Note 20"></a></p><h3 style="margin-left:0px;">Hiệu năng mạnh mẽ chuẩn flagship</h3><p style="margin-left:0px;">Galaxy Note 20 còn có hiệu năng vượt trội với tốc độ xử lý mạnh mẽ, đáp ứng mọi thao tác tác vụ một cách nhanh chóng nhờ chip xử lý Exynos 990 8 nhân, <a href="https://www.thegioididong.com/dtdd-ram-8gb">RAM 8 GB</a>/<a href="https://www.thegioididong.com/dtdd-rom-256gb">ROM 256 GB</a>, người dùng có thể sử dụng nhiều tác vụ cùng lúc một cách dễ dàng, mượt mà.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230420-020400.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230420-020400.jpg" alt="Hiệu năng mạnh mẽ - Samsung Galaxy Note 20"></a></p><p style="margin-left:0px;">Hơn nữa, với điểm AnTuTu đạt gần 500.000 điểm, việc <a href="https://www.thegioididong.com/dtdd-choi-game">điện thoại chơi game</a> ở mức cấu hình max setting&nbsp;là điều dễ dàng,&nbsp;hay render video cũng không làm khó được thiết bị này của Samsung.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-254320-094356.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-254320-094356.jpg" alt="Điểm số AnTutu - Samsung Galaxy Note 20"></a></p><h3 style="margin-left:0px;">Dung lượng pin lớn, thoải mái sử dụng</h3><p style="margin-left:0px;">Note 20 sở hữu cho mình viên pin dung lượng 4300 mAh, tăng thời lượng sử dụng lên tới 23% so với thế hệ Note 10 trước.</p><p style="margin-left:0px;">Bên cạnh đó sản phẩm còn hỗ trợ sạc pin nhanh, với khả năng sạc nhanh 25w từ 0 đến 50% chỉ trong vòng 30 phút, giúp bạn rút ngắn được đáng kể thời gian chờ sạc cho thiết bị.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230520-020535.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/218355/samsung-galaxy-note-20-230520-020535.jpg" alt="Pin lớn thoả sức sử dụng cả ngày dài - Samsung Galaxy Note 20"></a></p><p style="margin-left:0px;">Có thể thấy, Samsung Note 20 là một trong những siêu phẩm đáng sở hữu nhất trong năm 2020 với thiết kế thu hút ở cụm camera độc đáo, màu sắc mới lạ, màn hình siêu tràn viền cùng với những tính năng tiện ích nâng cấp của bút S Pen.</p>	["/media/device/media/media_wlj7211670504082439ng.jpeg"]	1	\N	1	2022-12-20 16:59:01.546777+00	1	\N
44	iphone	0	18000000	1000000	ipohne	{"qua_tang": ["reactjs"], "uu_dai_goi": []}	device/image/600_iphone_11_trang_xtmobile_XZROMaF.jpg	\N	{"Màn hình": [["amolled", "6.7inch"]]}	<h3 style="margin-left:0px;text-align:justify;"><a href="https://www.thegioididong.com/dtdd/samsung-galaxy-s22-ultra-256gb">Samsung Galaxy S22 Ultra 256GB</a> - chiếc điện thoại Galaxy S đầu tiên sở hữu bút S Pen trong thân máy, được cung cấp sức mạnh bởi CPU đến từ Qualcomm, sở hữu thiết kế sang trọng, màn hình có nhiều cải tiến cùng cụm camera zoom 100x.&nbsp;</h3><h3 style="margin-left:0px;text-align:justify;">Thiết kế khác biệt hoàn toàn thế hệ trước</h3><p style="margin-left:0px;text-align:justify;">Samsung Galaxy S22 Ultra 256GB ra mắt với một diện mạo “cũ mà mới”, máy sử dụng form thiết kế của dòng <a href="https://www.thegioididong.com/dtdd-samsung-galaxy-note">Galaxy Note</a> trước đây để đưa vào dòng <a href="https://www.thegioididong.com/dtdd-samsung-galaxy-s">Galaxy S</a>. Với hai cạnh trên và dưới vát phẳng, hai bên thì được bo cong mềm mại.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053939.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053939.jpg" alt="Thiết kế khác biệt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Đây cũng là một chiếc <a href="https://www.thegioididong.com/dtdd">smartphone</a> vô cùng bền bỉ khi khung viền được cấu thành từ Armor Aluminum cứng cáp và đây cũng là một trong những sản phẩm được trang bị kính Corning Gorilla Glass Victus+ đầu tiên trên thị trường.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060516.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060516.jpg" alt="Khung viền cứng cáp - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Mặt lưng hoàn thiện nhám, màu sắc khá sang và có khả năng hạn chế bám vân tay tốt, máy có các phiên bản màu như: Xanh lá, đỏ rượu vang và 2 màu truyền thống là đen và bạc.</p><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra cho cảm giác cầm nắm khá thích, khối lượng vừa phải, không bị cấn tay nhưng nếu cầm trần thì cảm giác hơi dễ trượt vì kích thước máy khá là lớn.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053941.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053941.jpg" alt="Cảm giác cầm rất tốt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Thiết kế cụm camera trên máy cũng là một điểm nhận dạng Galaxy S22 Ultra năm nay khác biệt so với dòng Note, cụm camera không còn quá lồi nữa giúp cho máy không bị kênh nhiều khi đặt trên mặt phẳng.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055511.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055511.jpg" alt="Cụm camera trên Samsung Galaxy S22 Ultra"></a></p><h3 style="margin-left:0px;text-align:justify;">Lần đầu tiên S Pen xuất hiện</h3><p style="margin-left:0px;text-align:justify;">Galaxy S22 là <a href="https://www.thegioididong.com/dtdd-samsung">điện thoại Samsung</a> dòng S đầu tiên trang bị bút S Pen bên trong máy, bút S Pen năm nay cũng đã được Samsung cải tiến nhiều về độ trễ, thời gian trễ được rút ngắn lại chỉ còn 2.8 ms nên cảm giác khi viết trên màn hình Galaxy S22 Ultra này khá là chân thật và chính xác.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053919.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053919.jpg" alt="S Pen đã có mặt trên Galaxy S - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tất cả các tính năng như viết, các chức năng ghi chú, Screen Note, Dịch đều giống như những gì đã có trên Galaxy Note, các cử chỉ điều khiển từ xa vẫn như trên thế hệ Note, bạn cũng có thể kích hoạt camera từ xa, chuyển đổi qua lại giữa các chế độ chụp rất nhanh chóng và chính xác. Phần giao diện dường như được cập nhật theo hướng to hơn, rõ ràng hơn.</p><h3 style="margin-left:0px;text-align:justify;">Camera độ phân giải cao, zoom cực xa</h3><p style="margin-left:0px;">Trang bị 4 ống kính với ống kính chính lên đến 108 MP, <a href="https://www.thegioididong.com/dtdd-camera-goc-rong">camera&nbsp;góc siêu rộng</a> 12 MP, 2 camera tele cùng 10 MP hỗ trợ thu phóng quang học 10x. Năm nay <a href="https://www.thegioididong.com/samsung">Samsung</a> đã nhấn mạnh rất nhiều qua cái câu tagline "Mắt thần bóng đêm", nhắc đến khả năng chụp đêm của Galaxy S22 Ultra.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055512.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055512.jpg" alt="Cụm camera siêu tốt - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Thật sự thì Samsung Galaxy S22 Ultra chụp thiếu sáng cực kỳ ngon, hình ảnh cực kỳ sáng, sắc nét và trong trẻo, không bị noise nhiều. Cân bằng ánh sáng tốt, các ánh đèn không bị cháy lóa như khi chụp thường, kể cả các ánh sáng phức tạp của đèn LED.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053932.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053932.jpg" alt="Ảnh chụp trong môi trường thiếu sáng - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tương phản được đẩy lên cao, tăng độ rực rỡ cho tấm hình kể cả khi sử dụng các mức zoom 3x hay 10x thì ảnh vẫn có độ chi tiết tốt.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-055514.jpg"><img alt="Ảnh chụp từ camera Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;"><i>Ảnh chụp từ camera góc thường</i></p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061957.jpg"><img alt="Ảnh chụp từ camera zoom - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;"><i>Ảnh chụp từ camera zoom</i></p><p style="margin-left:0px;text-align:justify;">Điều kiện đủ sáng thì không có gì để chê, hình ảnh cho ra rực rỡ, khả năng xử lý khi ngược sáng rất tốt, không bị cháy lóa, hình ảnh có độ tương phản cao cộng với chi tiết cao nên khá nịnh mắt.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053928.jpg"><img alt="Ảnh chụp từ camera chính - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Chế độ zoom 100x hoạt động cực kỳ ổn định, zoom xa và bắt ảnh khá nhanh và tất nhiên ảnh khi zoom 100x khá là mờ, khoảng cách tốt nhất để bức ảnh còn nét là khoảng 30-40x thôi.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053926.jpg"><img alt="Ảnh chụp từ camera zoom - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Chế độ chân dung có vẻ đã được cải thiện nhiều hơn so với thế hệ trước với ảnh xóa phông sâu, ít bị lẹm kể cả phần khó như tóc, độ chi tiết cao, ảnh tươi sáng và màu sắc khá chân thật. Hơn nữa máy cũng hỗ trợ nhiều chế độ chụp khác để bạn khám phá.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060509.jpg"><img alt="Hỗ trợ nhiều chế độ chụp - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra hỗ trợ <a href="https://www.thegioididong.com/hoi-dap/cac-chuan-quay-phim-tren-dien-thoai-tablet-pho-bi-1174134#8k">quay video 8K</a> tuy nhiên không đi kèm chống rung, nếu như bật chế độ Siêu ổn định lên thì độ phân giải sẽ bị giới hạn xuống Full HD 60 FPS. Bao nhiêu đó cũng khá đủ rồi, khung hình ổn định, ít bị giật, độ chi tiết cao và màu sắc cũng khá chân thật để chúng ta dễ dàng chỉnh sửa.</p><p style="margin-left:0px;text-align:justify;"><a href="https://www.thegioididong.com/dtdd-camera-macro">Camera macro</a> trên Galaxy S22 Ultra hoạt động khá giống với dòng iPhone 13 Pro, chỉ cần để chế độ chụp ảnh bình thường và dí sát vào vật thể thì máy sẽ tự động lấy nét và chuyển sang chụp macro.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053924.jpg"><img alt="Ảnh Macro chụp từ Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Camera trước lên đến 40 MP nên cho hình sống ảo của chúng ta sẽ chân thật hơn bao giờ hết, da vẫn được làm mịn nhẹ nhưng các chi tiết trên da đều sẽ được tái tạo rất rõ nét. Màu sắc khá rực rỡ nên không cần áp dụng thêm bộ lọc màu nữa.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053923.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053923.jpg" alt="Camera trước - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Camera trước cũng có khả năng quay video đến 4K 60 FPS, tự động lấy nét giúp bạn quay vlog tốt hơn.</p><h3 style="margin-left:0px;text-align:justify;">Nâng cao trải nghiệm thị giác</h3><p style="margin-left:0px;text-align:justify;">Galaxy S22 Ultra trang bị một màn hình khá lớn với kích thước 6.8 inch, tấm nền Dynamic Amoled 2X độ phân giải 2K+ hiển thị vô cùng sắc nét, màu đen sâu, màu sắc hài hòa, hỗ trợ dải màu rộng DCI-P3 và đây cũng là một cực phẩm hiển thị của giới smartphone ở thời điểm hiện tại.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053921.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053921.jpg" alt="Màn hình hiển thị tuyệt vời - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Tần số quét 120 Hz cũng là một trang bị không thể thiếu trên các điện thoại cao cấp, nó mang lại sự mượt mà cho tất cả tác vụ được hiển thị trên màn hình. Tần số quét sẽ được biến thiên tự động tùy vào nội dung mà chúng ta xem trên màn hình. Các thao tác vuốt chạm, các hiệu ứng hình ảnh sẽ đã mắt hơn bao giờ hết.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060940.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-060940.jpg" alt="Màn hình mượt mà - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Galaxy S22 có chế độ bảo vệ mắt giúp bảo vệ đôi mắt khỏi ánh sáng xanh phát ra từ màn hình điện tử để quá trình sử dụng điện thoại của bạn trở nên thoải mái hơn. Độ sáng tối đa 1750 nits hiển thị nội dung HDR hiệu quả hơn cũng như hiển thị nội dung ngoài trời nắng cũng tốt hơn.</p><p style="margin-left:0px;text-align:justify;">Với 1750 nits thì đây là một con số cực kỳ lớn, khi so với các sản phẩm cùng phân khúc thì nó cũng sáng hơn rất nhiều.</p><h3 style="margin-left:0px;text-align:justify;">Hiệu năng khủng với chip nhà Qualcomm</h3><p style="margin-left:0px;">Hiệu năng trên Galaxy S22 Ultra cũng là một điểm đáng khen khi máy sử dụng con chip Snapdragon 8 Gen 1 đầy drama về vấn đề quá nhiệt nhưng trên Galaxy S22 Ultra lại hoàn toàn khắc phục được.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061203.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-061203.jpg" alt="Hiệu năng mạnh mẽ - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Khi chơi game máy chỉ ấm lên một chút ở phần bên cạnh cụm camera chứ hoàn toàn không nóng bỏng tay như một số máy chạy Snap 8 Gen 1 trước đó. Các tác vụ làm việc văn phòng, học tập online như Word, Excel, Meet máy xử lý rất dễ dàng và nhanh chóng.</p><p style="margin-left:0px;text-align:justify;">Các tựa game Liên Quân Mobile hay PUBG Mobile thì chiếc máy này hoàn toàn dư sức cho bạn trải nghiệm chơi tốt nhất, có thể cài đặt cấu hình HDR mức đồ họa cực độ thì biểu đồ FPS của máy vẫn khá ổn định, không bị drop FPS nhiều.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053917.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053917.jpg" alt="Game PUBG Mobile - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Kể cả khi các bạn chơi Genshin Impact ở mức cấu hình mặc định thì máy chơi vẫn mượt, đồ họa vẫn rất đẹp. Chỉ đến khi bật 60 FPS lên thì máy mới bắt đầu xảy ra tình trạng giật lag, nhưng nó cũng chỉ thỉnh thoảng thôi, lúc đánh quái hay bay thì mới gặp.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053915.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053915.jpg" alt="Genshin Impact trên Samsung Galaxy S22 Ultra"></a></p><h3 style="margin-left:0px;text-align:justify;">Pin thoải mái sử dụng một ngày</h3><p style="margin-left:0px;text-align:justify;">Samsung Galaxy S22 Ultra trang bị viên pin 5000 mAh, công suất sạc thì đã được nâng lên thành 45 W. Sạc từ 0-50% trong khoảng 30 phút và mất khoảng 70 phút là đầy 100% pin.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053911.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053911.jpg" alt="Thời gian sạc - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Mình sử dụng nhiều tác vụ giải trí trong một ngày như YouTube, Facebook, rồi test game thì máy vẫn có thời gian sử dụng liên tục lên đến hơn 9 tiếng. Quá tốt cho một chiếc flagship trang bị cấu hình mạnh và màn hình độ phân giải cực cao như thế này.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053913.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/271697/samsung-galaxy-s22-ultra-256gb-030322-053913.jpg" alt="Thời gian sử dụng - Samsung Galaxy S22 Ultra"></a></p><p style="margin-left:0px;text-align:justify;">Ngoài ra S22 Ultra còn hỗ trợ một số công nghệ sạc khác như: Sạc nhanh không dây công suất 15 W, sạc ngược không dây 4.5 W để bạn đa dạng phương thức sạc cho phù hợp với nhu cầu sử dụng.</p><p style="margin-left:0px;text-align:justify;">Nếu bạn là một tín đồ của dòng Note, thì còn ngại ngùng gì nữa mà không chọn ngay chiếc S22 Ultra với cây bút S Pen cùng nhiều đặc điểm của dòng Note huyền thoại.&nbsp;Màn hình lớn cùng, pin trâu, cấu hình cực khỏe cũng là một điểm mà bạn nên cân nhắc với chiếc điện thoại này.</p>	["/media/device/media/media_ls19ow167653078263891d.jpg", "/media/device/media/media_9ht4zt16765307826418_n.jpg", "/media/device/media/media_i9w7yt1676530782644b2f.png"]	2	\N	1	2023-05-15 02:27:34.200738+00	162	
17	Samsung s10 Plus	0	10000000	1000000	Samsung Galaxy S10+ 128GB là một trong những chiếc smartphone được trông chờ nhiều nhất trong năm 2019 và không phụ sự kỳ vọng của mọi người thì chiếc Galaxy S thứ 10 của Samsung thực sự gây ấn tượng mạnh cho người dùng.	{"qua_tang": ["Tai nghe Galaxy Buds Pro"], "uu_dai_goi": [["Khuyến mãi lên đến 50% dịp giáng sinh", 2]]}	device/image/phone06.jpg	\N	{"Camera sau": [[["Độ phân giải", "Chính 12 MP & Phụ 12 MP, 16 MP"], ["Quay phim", " 4K 2160p@60fpsFullHD 1080p@240fps"], ["Đèn Flash", "Có"]]], "Màn hình": [[["Công nghệ màn hình", "Dynamic AMOLED"], ["Độ phân giải", "2K+ (1440 x 3040 Pixels)"], ["Mặt kính cảm ứng", "Kính cường lực Corning Gorilla Glass 6"], ["Màn hình rộng", "6.4\\""]]], "Camera trước": [[["Độ phân giải", " Chính 10 MP & Phụ 8 MP"]]], "Bộ nhớ & Lưu trữ": [[["RAM", "8 GB"], ["Thẻ nhớ", " MicroSD, hỗ trợ tối đa 512 GB"]]], "Hệ điều hành & CPU": [[["Hệ điều hành", " Android 9 (Pie)"], ["Chip xử lý (CPU)", "Exynos 9820 8 nhân"], ["Tốc độ CPU", "2 nhân 2.7 GHz, 2 nhân 2.3 GHz & 4 nhân 1.9 GHz"]]]}	<h3 style="margin-left:0px;">Thiết kế sang trọng, bóng bẩy</h3><p style="margin-left:0px;">Với một chiếc máy cao cấp như&nbsp;Samsung Galaxy S10+ thì việc đầu tiên cần có là máy phải sở hữu một vẻ ngoài "lộng lẫy", thu hút mọi ánh nhìn.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-5.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-5.jpg" alt="Thiết kế điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Và thậm chí <a href="https://www.thegioididong.com/dtdd-samsung">Samsung</a> còn làm tốt hơn như thế khi&nbsp;Samsung Galaxy S10+ sở hữu thiết kế 2 mặt kính đẹp mắt cùng việc loại bỏ đi cảm biến vân tay ở mặt lưng giúp máy liền mạch hơn.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-3.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-3.jpg" alt="Mặt lưng điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Trên&nbsp;Galaxy S10+ Samsung đã sở hữu công nghệ màn hình mới mà hãng gọi là&nbsp;<a href="https://www.thegioididong.com/hoi-dap/tong-hop-cac-loai-man-hinh-vo-cuc-moi-tren-dien-th-1150900#infinity-o">Infinity-O</a>,&nbsp;đảm bảo được viền màn hình mỏng ở tất cả các cạnh khiến kích thước máy không lớn hơn S9+ nhưng kích thước màn hình lại lớn hơn.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-1.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-1.jpg" alt="Màn hình điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Xem thêm:<a href="https://www.thegioididong.com/tin-tuc/tren-tay-danh-gia-chi-tiet-sieu-pham-samsung-galaxy-s10-va-galaxy-s10--1151126">Trên tay, đánh giá chi tiết siêu phẩm Samsung Galaxy S10 và Galaxy S10+</a></p><h3 style="margin-left:0px;">Trải nghiệm màn hình vô cực độc đáo</h3><p style="margin-left:0px;">Samsung Galaxy S10+ sở hữu màn hình có kích thước 6.4 inch, sử dụng tấm nền <a href="https://www.thegioididong.com/tin-tuc/man-hinh-dynamic-amoled-la-gi-no-co-cong-dung-gi-noi-bat-1153075">Dynamic AMOLED</a>&nbsp;với độ phân giải lên tới 2K+ cho hình ảnh hiển thị sắc nét và sống động.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-10.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-10.jpg" alt="Mặt trước điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Đặc biệt màn hình này còn có sự hỗ trợ của <a href="https://www.thegioididong.com/tin-tuc/hdr10-la-gi-vi-sao-no-lam-cho-man-hinh-galaxy-s10-dep-hon--1151189">công nghệ HDR10+</a>,&nbsp;nó cho phép màn hình hiển thị nhiều màu sáng hơn hoặc nhiều màu tối hơn phụ thuộc vào những gì đang hiển thị trên màn hình.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-7.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-7.jpg" alt="Màn hình điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Và với nội dung phù hợp, người sử dụng sẽ bị bất ngờ bởi chất lượng hình ảnh mà video có thể mang lại.</p><h3 style="margin-left:0px;">Cảm biến <a href="https://www.thegioididong.com/hoi-dap/cong-nghe-quet-van-tay-song-sieu-am-la-gi-912419">vân tay siêu âm</a> bên dưới màn hình</h3><p style="margin-left:0px;">Galaxy S10 là những điện thoại đầu tiên sử dụng công nghệ vân tay siêu âm dưới màn hình của Qualcomm, nó sử dụng sóng âm để đọc bản in ngón tay bạn.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-6.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-6.jpg" alt="Vân tay siêu âm điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Công nghệ này có thể hoạt động bằng cả trong điều kiện tay của bạn dính nước, kem dưỡng da và dầu mỡ, vào ban đêm hoặc dưới ánh sáng ban ngày.</p><p style="margin-left:0px;">Theo Samsung thì&nbsp;nó nhanh hơn và an toàn hơn nhiều so với cảm biến vân tay quang học mà bạn đã thấy ở các điện thoại khác trước đây.</p><h3 style="margin-left:0px;">Camera chất lượng hàng đầu thế giới</h3><p style="margin-left:0px;">Nếu bạn là một tín đồ của camera phone thì&nbsp;Samsung Galaxy S10+ là chiếc smartphone sinh ra để dành cho bạn.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-11.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-11.jpg" alt="Giao diện camera điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Máy sở hữu cụm 3 camera sau (cảm biến chính 12 MP và hai cảm biến phụ 12 MP và 16 MP) với một camera có thể thay đổi khẩu độ, một camera zoom phục vụ việc xóa phông và một camera góc siêu rộng cho chụp ảnh phong cảnh.</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/198986/samsung-galaxy-s10-plus-512gb-3.jpg">Ảnh chụp góc siêu rộng trên S10 Plus</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/198986/samsung-galaxy-s10-plus-512gb-1.jpg">Ảnh chụp góc thường&nbsp;trên S10 Plus</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;"><img src="https://cdn.tgdd.vn/Products/Images/42/198986/samsung-galaxy-s10-plus-512gb-2.jpg">Ảnh chụp bằng camera tele trên S10 Plus</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">Như vậy với chiếc&nbsp;Samsung Galaxy S10+ thì bạn có thể tự tin ghi lại những khoảnh khắc đẹp trong tất cả các điều kiện khác nhau với chất lượng "tuyệt vời".</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-2.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-2.jpg" alt="Ảnh chụp selfie từ camera của điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Khả năng quay video của máy cũng là điểm nổi bật với nhiều cải tiến đem đến các khung hình mượt mà, ổn định hình ảnh chất lượng.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-1.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-1.jpg" alt="Ảnh chụp từ camera của điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Với chế độ Siêu chống rung, Galaxy S10+ biến từng chuyển động thành video chất lượng tuyệt đỉnh, cho bạn những thước phim mượt mà.</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><p style="margin-left:0px;">&nbsp;</p><h3 style="margin-left:0px;">Camera selfie kép lần đầu tiên xuất hiện</h3><p style="margin-left:0px;">Samsung Galaxy S10+ là chiếc máy cao cấp đầu tiên của Samsung sở hữu cho mình camera selfie kép.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-3.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-tgdd-3.jpg" alt="Ảnh chụp selfie từ camera của điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Máy có bộ đôi camera trước với ống kính kính 10 MP và ống kính phụ 8 MP cho phép bạn có thể chụp ảnh xóa phông ngay với camera selfie.</p><h3 style="margin-left:0px;">Hiệu năng mạnh mẽ nhất thế giới Android</h3><p style="margin-left:0px;">Một chiếc máy đầu bảng như&nbsp;Samsung Galaxy S10+ thì chắc chắn phải được trang bị những gì tốt nhất của năm 2019 rồi.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-12.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-white-12.jpg" alt="Chơi game trên điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Cung cấp sức mạnh cho máy là con chip&nbsp;Exynos 9820 với 8 GB RAM cùng 128 GB bộ nhớ trong cho bạn thoải mái lưu trữ dữ liệu cá nhân.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-.jpg" alt="Điểm Antutu trên điện thoại Samsung S10 Plus"></a></p><p style="margin-left:0px;">Bên cạnh đó Samsung cũng giới thiệu tính năng quản lý hiệu suất thông minh cho phép&nbsp;Samsung Galaxy S10+ có thể mở nhanh các ứng dụng sử dụng nhiều và hạn chế các ứng dụng chạy ngầm ít sử dụng.</p><h3 style="margin-left:0px;">Nhiều tính năng cao cấp khác</h3><p style="margin-left:0px;">Trên&nbsp;Samsung Galaxy S10+ còn có một tính năng được rất nhiều người yêu thích đó chính là khả năng <a href="https://www.thegioididong.com/tin-tuc/tinh-nang-powershare-tren-galaxy-s10-la-gi-lam-sao-de-su-dung-no-1151089">sạc ngược không dây (PowerShare)</a> cho smartphone khác (có hỗ trợ sạc không dây tương ứng).</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-powershare.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/179530/samsung-galaxy-s10-plus-powershare.jpg" alt="PowerShare trên điện thoại Samsung Galaxy S10+ chính hãng"></a></p><p style="margin-left:0px;">Điều này có thể giúp bạn biến chiếc smartphone của mình thành một cục sạc không dây di động trong những trường hợp khẩn cấp.</p><p style="margin-left:0px;">Ngoài ra tiêu chuẩn kháng nước và bụi bẩn IP68 cao cấp nhất hiện nay vẫn xuất hiện trên máy đảm bảo bạn có thể sử dụng dưới các điều kiện khắc nghiệt mà máy không gặp vấn đề gì.</p>	["/media/device/media/media_0g2c9o1670504252197ng.jpeg", "/media/device/media/media_91p33016715548678757ng.jpe"]	1	\N	1	2022-12-20 16:50:18.722393+00	1	\N
25	Iphone 14 Pro Max	0	33590000	1000000	Cuối cùng thì chiếc iPhone 14 Pro Max cũng đã chính thức lộ diện tại sự kiện ra mắt thường niên vào ngày 08/09 đến từ nhà Apple, kết thúc bao lời đồn đoán bằng một bộ thông số cực kỳ ấn tượng cùng vẻ ngoài đẹp mắt sang trọng. Từ ngày 14/10/2022 người dùng đã có thể mua sắm các sản phẩm iPhone 14 series với đầy đủ phiên bản tại Thế Giới Di Động.	{"qua_tang": ["Tai nghe AirPods Pro"], "uu_dai_goi": [["Merry Christmas", 2]]}	device/image/phone01_5jv1ivX.jpg	\N	{"Camera sau": [["Độ phân giải", "Chính 48 MP & Phụ 12 MP, 12 MP"], ["Đèn Flash", " Có"]], "Màn hình": [["Công nghệ màn hình", " OLED"], ["Độ phân giải", " 2796 x 1290 Pixels"], ["Màn hình rộng", "6.7\\" - Tần số quét 120 Hz"], ["Độ sáng tối đa", " 2000 nits"], ["Mặt kính cảm ứng", " Kính cường lực Ceramic Shield"]], "Camera trước": [["Độ phân giải", " 12 MP"]], "Hệ điều hành & CPU": [["Hệ điều hành", "iOS 16"], ["Chip đồ họa (GPU)", "Apple GPU 5 nhân"], ["Chip xử lý (CPU)", "Apple A16 Bionic 6 nhân"], ["Tốc độ CPU", " 3.46 GHz"]]}	<h3 style="margin-left:0px;">Ngoại hình cao cấp</h3><p style="margin-left:0px;">Điện thoại iPhone mang trong mình vẻ ngoài hào nhoáng với kiểu tạo hình vuông vắn, đây là lối thiết kế rất trend hiện nay và vô cùng thành công đối với thế hệ trước khi đã định hình kiểu dáng cho những smartphone.</p><p style="margin-left:0px;"><a href="https://cdn.tgdd.vn/Products/Images/42/289702/iphone-14-pro-max-512gb-080922-104703.jpg"><img src="https://cdn.tgdd.vn/Products/Images/42/289702/iphone-14-pro-max-512gb-080922-104703.jpg" alt="Thiết kế hiện đại - iPhone 14 Pro Max 512GB"></a></p><p style="margin-left:0px;">Apple đã sử dụng chất liệu thép không gỉ để tạo nên khung viền điện thoại mang đến độ chắc chắn và bền bỉ, mặt lưng được làm từ kính tạo nên sự sang trọng thu hút mọi ánh nhìn, chính những điều này giúp máy trở nên đẳng cấp.</p><h3 style="margin-left:0px;">Sở hữu màn hình chất lượng</h3><p style="margin-left:0px;">Máy sở hữu tấm nền OLED với kích thư