1-160122-083037.jpg"><img src="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083037.jpg" alt="Màn hình cao cấp - iPad Pro M1 11 inch WiFi Cellular 1TB (2021)"></a></p><p style="margin-left:0px;text-align:justify;">Công nghệ <strong>ProMotion </strong>hỗ trợ tần số quét tối đa <strong>120 Hz</strong> cho cảm giác chạm vuốt cực mượt, các chi tiết chuyển động trên màn hình liền mạch, trơn tru, nhờ đó trải nghiệm được tối ưu, đặc biệt khi sử dụng màn hình cho tác vụ đồ họa hay cho các tựa game hành động, không bỏ lỡ cơ hội ghi điểm.</p><h3 style="margin-left:0px;text-align:justify;">Chinh phục mọi tác vụ với sức mạnh từ chip M1</h3><p style="margin-left:0px;text-align:justify;">Sức mạnh hiệu năng trên iPad Pro M1 đạt được nhờ sự cộng hưởng của <strong>chip Apple M1 8 nhân</strong> mạnh mẽ và&nbsp;<strong>chip đồ họa Apple GPU</strong> và <strong>RAM 16 GB</strong>. Hiệu quả đa nhiệm mượt mà, duy trì sự ổn định của máy cả khi sử dụng trên các tác vụ nặng như đồ họa, chơi game trực tuyến,… Đồng thời, với bộ nhớ trong đến&nbsp;<strong>1 TB</strong>, thật thoải mái để lưu trữ tất cả tài liệu và kho ảnh chụp, video yêu thích lên thiết bị cá nhân này.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083039.jpg"><img src="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083039.jpg" alt="Sức mạnh ấn tượng - iPad Pro M1 11 inch WiFi Cellular 1TB (2021)"></a></p><p style="margin-left:0px;text-align:justify;">Máy hỗ trợ 5G cho tốc độ kết nối cực nhanh để bạn có thể tải dữ liệu, xem video, thực hiện các tác vụ trực tuyến mượt mà.</p><h3 style="margin-left:0px;text-align:justify;">Thỏa sức sáng tạo cùng cụm camera xịn sò</h3><p style="margin-left:0px;text-align:justify;">iPad Pro trang bị bộ đôi camera gồm <strong>camera góc rộng 12 MP</strong> và <strong>camera siêu rộng 10 MP</strong>&nbsp;cùng với khả năng xử lý mạnh mẽ từ chip M1 giúp mang đến bức ảnh chụp và video hoàn hảo, không thua kém nhiều so với sử dụng smartphone.</p><p style="margin-left:0px;text-align:justify;"><strong>Camera TrueDepth 12 MP</strong> ở mặt trước hỗ trợ góc nhìn siêu rộng <strong>122 độ</strong>&nbsp;FaceTime cực tốt, kèm với tính năng <strong>Center Stage</strong> tự động nhận diện,&nbsp;căn góc để giúp cho chủ thể luôn ở giữa khung hình.</p><p style="margin-left:0px;text-align:justify;"><a href="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083041.jpg"><img src="https://cdn.tgdd.vn/Products/Images/522/269329/ipad-pro-m1-11-inch-wifi-cellular-1tb-2021-160122-083041.jpg" alt="Camera xịn sò - iPad Pro M1 11 inch WiFi Cellular 1TB (2021)"></a></p><p style="margin-left:0px;text-align:justify;">Ngoài ra, <a href="https://www.thegioididong.com/may-tinh-bang-apple-ipad">Apple</a> hỗ trợ tính năng mở khóa bằng&nbsp;khuôn mặt Face ID cũng gia tăng tiện ích và khả năng bảo mật cho iPad của bạn.</p><p style="margin-left:0px;text-align:justify;">Với nhu cầu dùng <a href="https://www.thegioididong.com/may-tinh-bang">máy tính bảng</a> ở tần suất cao, bạn sẽ khá yên tâm nhờ dung lượng pin của phiên bản iPad này đạt<strong> 28.65 Wh</strong> tương đương khoảng<strong> 7538 mAh</strong>, được sự tối ưu của chip M1 mang đến<strong> 10 giờ</strong> sử dụng liên tục cho nhu cầu lướt web hoặc xem video. Công nghệ <a href="https://www.thegioididong.com/may-tinh-bang-sac-pin-nhanh"><strong>sạc pin nhanh</strong></a><strong> 20 W</strong> sẽ nhanh chóng phục hồi năng lượng pin cho thiết bị trong tình huống cạn nguồn.</p>	["/media/device/media/media_iacs231670753204170-1.jpeg", "/media/device/media/media_u3ysv51670753204173-2.jpeg", "/media/device/media/media_5ac1rc1670753204175-3.jpeg", "/media/device/media/media_v3qldd16707532041771-4.jpg", "/media/device/media/media_e5fmwn1670753204179-5.jpeg", "/media/device/media/media_bu7g881670753204181-6.jpeg"]	2	\N	2	2022-12-22 12:59:00.900947+00	1	\N
