6	HỢP ĐỒNG ĐIỆN TỬ ECONTRACT	\N	10	\N	Hợp đồng điện tử là hợp đồng được thiết lập dưới dạng thông điệp điện tử theo quy định tại Điều 33 Luật giao dịch điện tử 2005.	["Đăng ký dùng thử 1 tháng hoàn toàn miễn phí"]	enterprise_solution/image/1_VDSHuQg.png	<p>Miễn phí lưu trữ , đa dạng hình thứ ký điện tử<br>Được chứng thực bởi Bộ công thương<br>Độ bảo mật cao, được lưu trữ server của MobiFone với công nghệ mã hóa MINIO<br>Giao diện thân thiện dễ sử dụng<br>Hỗ trợ ký hợp đồng theo mẫu, lô&nbsp;<br>Khả năng tích hợp linh hoạt&nbsp;</p><h2 style="text-align:justify;"><strong>MobiFone eContract là gì?</strong></h2><p style="text-align:justify;">MobiFone eContract là Giải pháp hợp đồng điện tử được phát triển bởi MobiFone, giúp số hóa quy trình ký kết hợp đồng giữa Doanh nghiệp với Doanh Nghiệp hoặc giữa Doanh nghiệp với các cá nhân, từ đó giúp doanh nghiệp tối giản được chi phí, tối ưu quy trình mua bán hàng hóa, đồng thời hạn chế các rủi ro pháp lý và tăng mức độ cạnh tranh trên thị trường.</p><p style="text-align:justify;">MobiFone eContract đáp ứng đầy đủ tiêu chuẩn pháp lý về Hợp đồng điện tử được pháp luật Việt Nam công nhận: Luật giao dịch điện tử số 51/2005/QH11, nghị định 52/2013/NĐ-CP, nghị định 130/2018/NĐ-CP, Bộ luật lao động 2019… và các Bộ luật/Nghị định khác của Chính phủ quy định.</p><p style="text-align:justify;">Hợp đồng điện tử MobiFone eContract có đầy đủ các tính năng của các loại hình hợp đồng điện tử trên thị trường hiện nay, đáp ứng đầy đủ 7 tiêu chí: Không phí in ấn, không phí chuyển phát, không phí lưu kho, không phụ thuộc không gian địa lý, không phụ thuộc thời gian, không rủi ro thất lạc và không gián đoạn thời gian.</p><p><br>&nbsp;</p><figure class="image"><img src="https://mobi8-ms.pvssolution.com:10183/media/up_file/0m0pbkfile_img.png"></figure>	\N	f	2023-02-03 06:54:57.890524+00	2023-04-24 02:08:49.174171+00	162	t	6	\N
