18	MOBIFONE CÔNG PHÁ "KHÔNG GIAN MỚI"	Cre: Tuổi trẻ online		<h2 style="margin-left:0px;"><strong>Năm 2022, MobiFone dự kiến doanh thu công ty mẹ tính theo phương pháp ghi nhận ‘doanh thu theo dung lượng thực tế sử dụng’ ước đạt 28.329 tỉ đồng, lợi nhuận trước thuế ước tính đạt 2.713 tỉ đồng.</strong></h2><p style="margin-left:0px;">Doanh thu từ không gian mới "Make in MobiFone" tăng trưởng trên 60% so với 2021</p><h2 style="margin-left:0px;"><strong>Doanh thu data tăng gần 27% so với năm 2021</strong></h2><p style="margin-left:0px;">Hầu hết các doanh nghiệp đều đặt mục tiêu thận trọng trong năm 2022 khi đưa ra các dự báo khó khăn cho nền kinh tế sau dịch COVID-19.</p><p style="margin-left:0px;">Tuy nhiên, những gì diễn ra trong năm 2022 thậm chí vượt qua mọi dự báo trước đó của các chuyên gia cũng như các tổ chức tài chính hàng đầu thế giới như diễn biến cuộc chiến tranh giữa Nga và Ukraine; giá nguyên vật liệu, giá dầu tăng đột biến; lạm phát phủ bóng đen nên nền kinh tế toàn cầu; lãi suất tăng ở hầu hết các thị trường hay chính sách Zero COVID nghiêm ngặt tại Trung Quốc…</p><p style="margin-left:0px;">Những diễn biến này khiến hoạt động sản xuất, kinh doanh của các doanh nghiệp đều bị ảnh hưởng.</p><p style="margin-left:auto;"><a href="https://cdn.tuoitre.vn/471584752817336320/2023/1/7/photo-1-16730843153441238617221.jpg"><img class="image_resized" style="width:730px;" src="https://cdn.tuoitre.vn/thumb_w/730/471584752817336320/2023/1/7/photo-1-16730843153441238617221.jpg" alt="Doanh thu từ ‘Không gian mới’ của MobiFone tăng trưởng hơn 60% - Ảnh 2."></a></p><p style="margin-left:0px;">Thị trường viễn thông gặp nhiều khó khăn sau đại dịch</p><p style="margin-left:0px;">Báo cáo kết quả kinh doanh năm 2022, MobiFone cho biết, dự kiến doanh thu công ty mẹ tính theo phương pháp ghi nhận "doanh thu theo dung lượng thực tế sử dụng" ước đạt 28.329 tỉ đồng, lợi nhuận trước thuế công ty mẹ ước đạt 2.713 tỉ đồng.</p><p style="margin-left:0px;">Theo hướng dẫn của Bộ Tài chính và Bộ Thông tin và Truyền thông và bắt đầu áp dụng từ năm 2022, các chỉ tiêu trên được hạch toán theo phương pháp ghi nhận "doanh thu theo dung lượng thực tế sử dụng" thay vì phương pháp ghi nhận "doanh thu tại thời điểm thu tiền bán thẻ trả trước".</p><p style="margin-left:0px;">Năm 2022, MobiFone đã bám sát chiến lược phát triển của tổng công ty đến năm 2030 với 3 trụ cột chủ lực: Hạ tầng số, Giải pháp số/Nền tảng số và Dịch vụ nội dung số.</p><p style="margin-left:0px;">Cụ thể, triển khai công tác phát triển thuê bao song song với việc tăng cường rà soát, quản lý, chuẩn hóa thông tin thuê bao theo quy định của Nhà nước và xác định đây là công việc thường xuyên, cần thiết để xây dựng cơ sở dữ liệu chính xác, đẩy đủ cho việc triển khai các dịch vụ mới.</p><p style="margin-left:0px;">Tập trung đẩy mạnh kinh doanh data để bù đắp cho sự sụt giảm doanh thu các dịch vụ viễn thông di động, doanh thu data năm 2022 dự kiến ước đạt mức tăng trưởng gần 27% so với thực hiện năm 2021.</p><p style="margin-left:0px;">Từ tháng 4/2022, công ty ra mắt hệ sinh thái Tài chính số với Dịch vụ Ví điện tử MobiFone Pay và Tiền điện tử Mobile Money đã cung cấp tới người dùng với đầy đủ các tính năng cơ bản của một dịch vụ tài chính.</p><p style="margin-left:0px;">Hết năm 2022, dự kiến sẽ phát triển 600 nghìn user đăng ký sử dụng các dịch vụ với doanh thu bán hàng trên 550 tỷ, mở ra một hướng đi mới trong việc hoàn thiện Hệ sinh thái MobiFone mang tới cho khách hàng.</p><p style="margin-left:0px;">Thống kê đến tháng 12/2022, tổng số khách hàng Mobile Money khoảng gần 3 triệu, trong đó số lượng khách hàng ở nông thôn, miền núi, vùng sâu, vùng xa là hơn 2 triệu khách hàng, chiếm 70%, như vậy tiềm năng tăng trưởng của mảng Mobile Money vẫn còn rất lớn.</p><p style="margin-left:0px;">Trong năm 2022, công ty đã đẩy mạnh định hướng "Make in MobiFone" và sản xuất công nghiệp, mang lại doanh thu tăng trưởng trên 60% so với 2021. Đặc biệt, công ty là 1 trong 5 đơn vị đầu tiên tại Việt Nam được phép cung cấp dịch vụ chứng thực hợp đồng điện tử, hướng đến mục tiêu doanh nghiệp 4.0.</p><p style="margin-left:0px;">Công ty cũng tập trung đẩy mạnh chuyển đổi số nội bộ và chuyển đổi số cho xã hội thông qua việc tích cực tham gia công tác xây dựng nền tảng Chuyển đổi số Quốc gia và đăng ký tham gia vào mạng lưới hỗ trợ Chuyển đổi số các doanh nghiệp SME.</p><p>&nbsp;</p><p style="margin-left:0px;">Nghiên cứu phát triển sản phẩm MobiFone Meeting là sản phẩm họp trực tuyến thế hệ mới do chính các kỹ sư Công nghệ thông tin của công ty tạo nên.</p><p style="margin-left:0px;">Hệ thống có thể họp trực tuyến cùng lúc tới 1.000 điểm cầu bật camera với chất lượng hình ảnh, âm thanh rõ nét. Hiện tại, hệ thống đã được Bộ Thông tin truyền thông đưa vào thử nghiệm diện rộng tại Bộ, các tỉnh/thành phố, tiến tới công nhận là nền tảng Chuyển đổi số Quốc gia.</p><p style="margin-left:0px;">Ngoài ra, MobiFone đã cung cấp trải nghiệm dịch vụ 5G thương mại cho khách hàng tại TP.HCM, Hà Nội, Huế, Nha Trang, Phú Quốc với tốc độ DL cao trên 1.7Gbps, với nhiều dịch vụ hấp dẫn như: truy cập internet tốc độ siêu cao, dịch vụ video theo yêu cầu với độ nét cao 4K/8K, dịch vụ thực tế ảo VR/AR, dịch vụ Cloud gaming…</p><h2 style="margin-left:0px;"><strong>Hướng đi mới khi nguồn thu chính đã bão hòa</strong></h2><p style="margin-left:0px;">Trước thực tế thị trường viễn thông di động (thoại/sms) đã bão hòa, doanh thu có xu hướng giảm, bài toán đặt ra với MobiFone nói riêng và các nhà mạng đang hoạt động trên thị trường là tìm kiếm và đẩy mạnh những nguồn thu khác để bù đắp.</p><p style="margin-left:0px;">Theo đó, năm 2023, công ty sẽ thực hiện chiến lược đẩy mạnh kinh doanh trên các lĩnh vực mới như tài chính số, y tế số, giáo dục số, …vốn cần nhiều nguồn lực về hệ thống, con người trong giai đoạn đầu triển khai.</p><p style="margin-left:0px;">Lãnh đạo MobiFone cho biết, dự kiến đến năm 2025 doanh nghiệp sẽ phát triển hạ tầng số trong nhóm dẫn đầu, làm chủ công nghệ lõi, cải thiện nhanh trong việc phát triển khách hàng mới, giữ chân khách hàng hiện hữu và tạo nhiều nguồn thu mới, tăng trưởng mạnh mẽ doanh thu dịch vụ số.</p><p style="margin-left:auto;"><a href="https://cdn.tuoitre.vn/471584752817336320/2023/1/7/photo-2-16730843161151606460036.jpg"><img class="image_resized" style="width:730px;" src="https://cdn.tuoitre.vn/thumb_w/730/471584752817336320/2023/1/7/photo-2-16730843161151606460036.jpg" alt="Doanh thu từ ‘Không gian mới’ của MobiFone tăng trưởng hơn 60% - Ảnh 3."></a></p><p style="margin-left:0px;">Chuyển mình lên nền tảng số là hướng đi mới của nhiều doanh nghiệp</p><h2 style="margin-left:0px;"><strong>Mục tiêu của MobiFone</strong></h2><p style="margin-left:0px;">- Trở thành doanh nghiệp thuộc nhóm hạt nhân góp phần thúc đẩy chuyển đổi số quốc gia;</p><p style="margin-left:0px;">- Đi hàng đầu trong việc đầu tư, hỗ trợ các doanh nghiệp khác trong phát triển hạ tầng số và chuyển đổi số;</p><p style="margin-left:0px;">- Thực hiện tốt vai trò dẫn dắt về hạ tầng công nghệ số, nền tảng cho kinh tế số, xã hội số gắn với đảm bảo an toàn, an ninh thông tin;</p><p style="margin-left:0px;">- Sản xuất thiết bị phục vụ hệ thống 5G; chuyển giao công nghệ cho các doanh nghiệp khác.</p><p style="margin-left:0px;">- Đi đầu thực hiện các chiến lược quốc gia, chiến lược ngành thông tin và truyền thông.</p>	2023-02-03 08:09:25.128342+00	0	\N	\N	2023-02-14 03:46:38.933343+00	0
