19	MOBIFONE KÝ KẾT THOẢ THUẬN HỢP TÁC VỚI AMAZON WEB SERVICES	Chiều ngày 27/2/2023 theo giờ Tây Ban Nha, Tổng công ty Viễn thông MobiFone đã ký kết thoả thuận hợp tác với Amazon Web Services. “Bắt tay” với “người khổng lồ” trong lĩnh vực điện toán đám mây, MobiFone kỳ vọng lộ trình chuyển đổi thành doanh nghiệp công nghệ sẽ có thêm động lực để đẩy nhanh tiến độ, nhanh chóng và hiệu quả hơn.		<p style="margin-left:0in;text-align:justify;"><span style="color:#2C3E50;">Buổi lễ ký kết nằm trong khuôn khổ chương trình làm việc của đoàn công tác Tổng công ty Viễn thông MobiFone tại Hội nghị Di động thế giới MWC2023 diễn ra ở Barcelona, Tây Ban Nha từ ngày 27/2/2023 đến ngày 2/3/2023.</span></p><p style="margin-left:0in;text-align:justify;"><span style="color:#2C3E50;">Tham dự buổi ký kết có ông Nguyễn Hoàng Anh – Chủ tịch Uỷ ban Quản lý vốn Nhà nước tại doanh nghiệp cùng lãnh đạo một số Vụ thuộc Ủy ban. Về phía Tổng công ty Viễn thông MobiFone, có ông Nguyễn Hồng Hiển – Chủ tịch HĐTV Tổng công ty Viễn thông MobiFone cùng một số đại diện lãnh đạo và các đơn vị trực thuộc.</span></p><p style="margin-left:0in;text-align:justify;"><span style="color:#2C3E50;">Về phía Amazon Web Services có ông Nagarajan, Jayanth – Giám đốc khối Viễn thông khu vực Châu Á Thái Bình Dương và Nhật Bản, ông Naoki Takaya – Quản lý phát triển kinh doanh khu vực Châu Á Thái Bình Dương và Nhật Bản.</span></p><p style="margin-left:0in;text-align:justify;"><span style="color:#2C3E50;">Theo thoả thuận đã ký kết, Amazon Web Services sẽ cung cấp các dịch vụ trên nền tảng AWS cho MobiFone; Cung cấp dịch vụ tư vấn cho MobiFone và khách hàng của MobiFone; cung cấp Dịch vụ đào tạo chứng chỉ AWS cho CBCNV của MobiFone; hợp tác cung cấp giải pháp Chuyển đổi số và cloud cho Doanh nghiệp (SME, KHCP, các doanh nghiệp startup) trong các lĩnh vực ngành nghề; Dịch vụ hỗ trợ của AWS.</span></p><p><span style="color:#2C3E50;">Ký kết hợp tác với Amazon Web Service, MobiFone hy vọng sẽ phát huy và cộng hưởng từ thế mạnh của doanh nghiệp hàng đầu trong lĩnh vực điện toán đám mây. Hai bên sẽ cùng sát cánh trên lộ trình chuyển đổi số, hướng tới mục tiêu đem lại cho khách hàng những dịch vụ vượt trội, đồng thời giúp Amazon Web Service tiếp cận sâu hơn vào thị trường Việt Nam.</span></p>	2023-04-21 05:41:16.915161+00	0	\N	\N	2023-04-21 05:41:16.915183+00	0
