1	Black Friday	\N	promotion/image/2a84ebb4-0686-42cc-8d5a-b1ebfa50cfc6_QcyFMVY.png	<div class="news-detail-left clearfix">\n                            <div class="title">Khuyến mại cực bốc - Deal sốc cuối năm</div>\n                            <span class="khuyen-mai">Khuyến mại</span>\n                            <div class="content">\n                            <p><em>Vui chơi, giải trí thả ga dịp cuối năm mà không lo hết tiền điện thoại với chương trình khuyến mại 55% khi nạp tiền qua ứng dụng MyPoint ngày 28/12/2022.&nbsp;</em></p>\n\n<p>Hoà cùng với không khí rộn ràng cuối năm và niềm háo hức chào đón một năm mới rực rỡ, MobiFone và ứng dụng MyPoint đem đến chương trình khuyến mại chất lượng để khách hàng yên tâm đón năm mới với bạn bè, người thân dù ở xa hay gần mà không lo gián đoạn.&nbsp;</p>\n\n<p style="text-align:center"><img alt="" src="https://api.mobifone.vn/images/notifications/1672193868893_505x324 final final final.png" style="width:80%"></p>\n\n<p>Theo đó, từ 0h00 đến hết 23h59 ngày 28/12/2022, MobiFone tặng 50% mệnh giá nạp tiền vào tài khoản khuyến mại khi khách hàng nạp tiền trên ứng dụng MyPoint.</p>\n\n<p>Mức tặng 50% được áp dụng cho tất cả các lần nạp trong thời gian khuyến mại, trong đó, 30% vào tài khoản KM1T, 10% vào tài khoản KM2T, 10% vào tài khoản KM3T (thời gian sử dụng T=15 ngày).&nbsp;</p>\n\n<p>Đặc biệt, tặng thêm 5% điểm tích lũy MyPoint trong thời gian khuyến mại. Điểm này có thể dùng để đổi thẻ cào, voucher mua sắm tại hơn 100 thương hiệu lớn trên ứng dụng MyPoint.</p>\n\n<p>Tải app MyPoint ngay tại: <a href="https://bit.ly/WebsiteMBF">https://bit.ly/WebsiteMBF</a> để không bỏ lỡ ưu đãi!</p>\n                            </div>\n                                                                                    <div class="share-box">\n                                <div class="row">\n                                    <div class="col-md-6">\n                                        <div class="fb-share-button fb_iframe_widget