5	TUYỂN CÔNG TÁC VIÊN BÁN HÀNG	<h2 style="margin-left:0px;"><span style="background-color:transparent;color:rgb(0,0,128);"><strong>Mô tả công việc</strong></span></h2><ul><li><span style="background-color:transparent;">Làm việc trực tiếp tại công ty 4 giờ/ngày và 3 ngày/tuần.</span></li><li><span style="background-color:transparent;">Cập nhập các kiến thức mới về dịch vụ.</span></li><li><span style="background-color:transparent;">Phối hợp với nhân viên kinh doanh chính thức của vHost triển khai các chương trình khuyến mãi dịch vụ trên các kênh online như: mạng xã hội, forum, workshop, group trên facebook, offline…</span></li><li><span style="background-color:transparent;">Tìm kiếm khách hàng và mở rộng các mối quan hệ dựa trên các quan hệ cá nhân của mình.</span></li><li><span style="background-color:transparent;">Mở rộng các mối quan hệ với khách hàng và duy trì quan hệ với khách hàng thường xuyên.</span></li><li><span style="background-color:transparent;">Theo dõi và hỗ trợ cộng đồng trên các mạng xã hội, forum, website để nắm bắt xu thế của khách hàng cũng như đóng góp ý kiến cho công ty.</span></li><li><span style="background-color:transparent;">Theo dõi cộng đồng trên các mạng xã hội và diễn đàn để thu thập các phản hồi của khách hàng về dịch vụ tại công ty. Sau đó trình lên các bộ phận cấp cao hơn để xin ý kiến hỗ trợ xử lý trong trường hợp không xử lý được.</span></li><li><span style="background-color:transparent;">Thu thập thông tin nhu cầu của khách hàng, phân tích và phối hợp cùng nhân viên kinh doanh chính thức tư vấn cho khách hàng.</span></li><li><span style="background-color:transparent;">Tư vấn cho khách hàng về các dịch vụ của công ty, thuyết phục khách hàng và tiến hành ký kết hợp đồng, hoàn tất các thủ tục đăng ký và nhận thanh toán với khách hàng.</span></li><li><span style="background-color:transparent;">Đảm bảo làm việc đúng theo quy trình công ty đề ra.</span></li><li><span style="background-color:transparent;">Và một số công việc khác do công ty đề xuất.</span></li></ul><h2 style="margin-left:0px;"><span style="background-color:transparent;color:rgb(0,0,128);"><strong>Yêu cầu</strong></span></h2><p style="margin-left:0px;"><strong>Kỹ năng chuyên môn:</strong></p><ul><li><span style="background-color:transparent;">Đang là sinh viên năm 3/4 tại các trường Cao đẳng/Đại học các khối Marketing, QTKD, Ngoại thương, Công nghệ thông tin hoặc các ngành có liên quan.</span></li><li><span style="background-color:transparent;">Có hiểu biết cơ bản về marketing, quảng cáo và truyền thông trực tuyến.</span></li><li><span style="background-color:transparent;">Ngoại ngữ: nghe, nói, đọc, viết.</span></li><li><span style="background-color:transparent;">Có ngoại hình ưa nhìn, khả năng giao tiếp tốt.</span></li><li><span style="background-color:transparent;">Thông minh, nhanh nhẹn, trung thực và chăm chỉ.</span></li><li><span style="background-color:transparent;">Kỹ năng viết lách tốt.</span></li><li><span style="background-color:transparent;">Kỹ năng đàm phán và thương lượng tốt.</span></li><li><span style="background-color:transparent;">Tư duy xử lý tình huống nhanh nhẹn.</span></li><li><span style="background-color:transparent;">Thành thạo các công cụ văn phòng như: Word, Excel, PowerPoint, Outlook.</span></li></ul><p style="margin-left:0px;"><strong>Kỹ năng mềm</strong><span style="background-color:transparent;">:</span></p><ul><li><span style="background-color:transparent;">Kỹ năng viết và trình bày tài liệu kỹ thuật rõ ràng, mạch lạc.</span></li><li><span style="background-color:transparent;">Tư duy có hệ thống và khả năng chủ động tổ chức, sắp xếp công việc.</span></li><li><span style="background-color:transparent;">Làm việc theo nhóm.</span></li><li><span style="background-color:transparent;">Trình bày thuyết trình.</span></li></ul><p style="margin-left:0px;"><strong>Yêu cầu đặc biệt</strong><span style="background-color:transparent;">:</span></p><ul><li><span style="background-color:transparent;">Sẵn sàng hỗ trợ đồng nghiệp trong công việc.</span></li><li><span style="background-color:transparent;">Làm việc có trách nhiệm với công việc được giao.</span></li><li><span style="background-color:transparent;">Tinh thần cầu tiến cao và luôn biết học hỏi các mô hình công việc mới để áp dụng cho công việc ngày một tốt hơn.</span></li><li><span style="background-color:transparent;">Chủ động thực hiện các công việc được giao, đưa ra phương án thực hiện công việc, báo cáo kết quả công việc rõ ràng.</span></li><li><span style="background-color:transparent;">Chịu được áp lực công việc cao.</span></li></ul>	2023-02-02 07:30:02.842019+00	2023-01-03 08:09:25.128342+00	2023-03-02 01:56:26.555613+00	0	3	\N	5 triệu đồng/ tháng (chưa tính hoa hồng)	189 Nguyễn Văn Linh, Quận 7
