1	\N	intro_setting	\N	<h4><span style="font-family:'Times New Roman', Times, serif;">Công ty Dịch vụ MobiFone Khu vực 8 (Trực thuộc Tổng Công Ty viễn thông MobiFone), Trụ sở đặt tại 236A Phan Trung, Phường Tân Tiến, TP. Biên Hòa, Tỉnh Đồng Nai. Thực hiện kinh doanh trong phạm vi các tỉnh: Đồng Nai, Bà Rịa – Vũng Tàu, Bình Dương, Bình Phước, Bình Thuận, Lâm Đồng, Long An, Ninh Thuận, Tây Ninh. cung cấp các dịch vụ về viễn thông và thiết bị di động cho khách hàng. Để thuận tiện hơn cho khách hàng trong việc tìm kiếm một thiết bị di động, gói cước 3G/4G và đặc biệt là sim số đẹp theo nhu cầu, website của Công ty dịch vụ MobiFone KV8 ra đời.</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Tên chính thức: CÔNG TY DỊCH VỤ MOBIFONE KHU VỰC 8&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Trực thuộc: Tổng Công Ty viễn thông MobiFone</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Ngày thành lập: 10/02/2015</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Trụ sở&nbsp;chính&nbsp;đặt tại 236A Phan Trung, Phường Tân Tiến, TP. Biên Hòa, Tỉnh Đồng Nai..</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;"><i>(Căn cứ Quyết định số 410/QĐ-MOBIFONE-TCHC ngày 16 tháng 03 năm 2015 của Tổng Giám đốc Tổng Công ty về việc thành lập các đơn vị thuộc Công ty Dịch vụ MobiFone Khu vực 8 thuộc Tổng Công ty Viễn thông MobiFone).&nbsp;</i></span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">(Công ty Dịch vụ MobiFone Khu vực 8 tiền thân là Trung tâm Thông tin Di động Khu vực VI thành lập ngày:29/12/2010 theo Quyết định số 2132/QĐ-VMS-TC ngày 29 tháng 12 năm 2010 của Chủ tịch Công ty Thông tin di động về việc thành lập Trung tâm thông tin di động khu vực VI thuộc Công ty Thông tin di động)&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Thực hiện kinh doanh trong phạm vi&nbsp;9 tỉnh: Đồng Nai, Bà Rịa – Vũng Tàu, Bình Dương, Bình Phước, Bình Thuận, Lâm Đồng, Long An, Ninh Thuận, Tây Ninh về&nbsp;cung cấp các dịch vụ về viễn thông và thiết bị di động cho khách hàng.&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">Chức năng:&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">+ Tổ chức, thực hiện công tác kinh doanh (bao gồm bán hàng, chăm sóc khách hàng, truyền thông…) toàn bộ các dịch vụ do Tổng Công ty cung cấp ( dịch vụ viễn thông, dịch vụ giá trị gia tăng, dịch vụ công nghệ thông tin…) đối với tất cả các nhóm khách hàng của Tổng công ty theo quy hoạch và kế hoạch phát triển của Tổng Công ty.&nbsp;</span></h4><h4 style="text-align:justify;"><span style="font-family:'Times New Roman', Times, serif;">+ Triển khai các nhhiệm vụ khác do Tổng Công ty giao.</span></h4><figure class="image"><img src="https://mobi8-ms.pvssolution.com:10183/media/up_file/7zcmltfile_img.png" alt="Giới Thiệu - Mobifone"></figure><p>&nbsp;</p>	\N	TEXT	t
